				}
				if (num == k)
				{
					PagingButtons.Add(new PageButton(k.ToString(), k));
					return;
				}
				PagingButtons.Add(new PageButton("...", k));
				PagingButtons.Add(new PageButton(num.ToString(), num));
			}
			else if (num2 < Page && Page <= num)
			{
				PagingButtons.Add(new PageButton("1", 1));
				PagingButtons.Add(new PageButton("...", Page - 5 + 1));
				for (int l = Page - 5 + 2; l <= num; l++)
