namespace ReadyM.Launcher.Update
{
	public enum UpdateState
	{
		None,
		Downloading,
		ReadyToRestart
	}
	public class AutoUpdate(IUpdateManager updateManager, AuthManager authManager, ILogger<AutoUpdate> logger) : BackgroundService()
	{
		private UpdateInfo? _update;

		private readonly SemaphoreSlim _updateCheckSemaphore = new SemaphoreSlim(1, 1);

		public UpdateState State { get; private set; }

		public event Action<UpdateState>? OnStateChanged;

		public event Action<int>? OnUpdateProgress;

		protected override async Task ExecuteAsync(CancellationToken ct)
		{
			logger.LogInformation("Starting automatic update check...");
			await CheckForUpdatesAsync(ct);
		}

		public void RestartAndApplyUpdates()
		{
			if (_update != null)
			{
				logger.LogInformation("Applying downloaded update {Version} and restarting application...", _update.TargetFullRelease.Version);
				string[] restartArgs = ((!authManager.LaunchedThroughXModo) ? Array.Empty<string>() : new string[1] { ReadyM.Launcher.Core.Protocol.Constants.UrlForHost("auto-update-xmodo-restart").ToString() });
				updateManager.WaitExitThenApplyUpdates(_update, silent: true, restart: true, restartArgs);
				App.Instance.Shutdown();
			}
			else
			{
				logger.LogError("Attempted to apply updates, but no update was downloaded.");
			}
		}

		private async Task CheckForUpdatesAsync(CancellationToken ct)
		{
			if (!updateManager.IsInstalled)
			{
				logger.LogWarning("Application is not installed via Velopack. Skipping update check.");
				return;
			}
			await _updateCheckSemaphore.WaitAsync(ct);
			try
			{
				if (_update != null)
				{
					return;
				}
				UpdateInfo updateInfo = await updateManager.CheckForUpdatesAsync();
				if (updateInfo != null)
				{
					_update = updateInfo;
					SetState(UpdateState.Downloading);
					logger.LogInformation("New version {Version} available. Downloading...", _update.TargetFullRelease.Version);
					Stopwatch stopwatch = Stopwatch.StartNew();
					await updateManager.DownloadUpdatesAsync(_update, delegate(int i)
					{
						this.OnUpdateProgress?.Invoke(i);
					}, ct);
					logger.LogInformation("Downloaded new version {Version} in {Elapsed}s.", _update.TargetFullRelease.Version, stopwatch.Elapsed.TotalSeconds);
					SetState(UpdateState.ReadyToRestart);
				}
			}
			catch (Exception exception)
			{
				logger.LogError(exception, "Failed to update the application.");
			}
			finally
			{
				_updateCheckSemaphore.Release();
			}
		}

		private void SetState(UpdateState state)
		{
			State = state;
			this.OnStateChanged?.Invoke(State);
		}
	}
	public class DebugUpdateManager : IUpdateManager
	{
		public bool IsInstalled => true;

		public async Task<UpdateInfo?> CheckForUpdatesAsync()
		{
			Version version = Assembly.GetExecutingAssembly().GetName().Version;
			SemanticVersion nextVersion = new SemanticVersion(version.Major, version.Minor, version.Build + 1);
			await Task.Delay(3000);
			return new UpdateInfo(new VelopackAsset
			{
				Version = nextVersion,
				Type = VelopackAssetType.Delta
			}, isDowngrade: false);
		}

		public void WaitExitThenApplyUpdates(VelopackAsset? toApply, bool silent = false, bool restart = true, string[]? restartArgs = null)
		{
			if (restart)
			{
				string[] value = restartArgs ?? Array.Empty<string>();
				Process.Start(new ProcessStartInfo
				{
					FileName = Environment.ProcessPath,
					Arguments = string.Join(" ", value),
					UseShellExecute = true
				});
			}
		}

		public async Task DownloadUpdatesAsync(UpdateInfo updates, Action<int>? progress = null, CancellationToken cancelToken = default(CancellationToken))
		{
			int randomSeconds = new Random().Next(4, 10);
			for (int i = 0; i <= randomSeconds * 2; i++)
			{
				cancelToken.ThrowIfCancellationRequested();
				await Task.Delay(500, cancelToken);
				progress?.Invoke(i * 100 / (randomSeconds * 2));
			}
		}
	}
