	public class NotificationManager(ILocalizer localizer, ILogger<NotificationManager> logger) : INotificationDisplay
	{
		public event Action<NotificationType, string, Action?>? OnNotificationRequested;

		public void ShowNotification(NotificationType type, string message, Action? onClick = null)
		{
			Dispatcher.UIThread.Post(delegate
			{
				logger.LogDebug("Notification: {Type} - {Message}", type, message);
				if (onClick == null)
				{
					onClick = ((message == Resources.Servers_UserNotLinkedWithXModo) ? new Action(OpenXModoWebsite) : null);
				}
				this.OnNotificationRequested?.Invoke(type, message, onClick);
			});
		}

		public void ShowResponseNotification(IApiResponse response, string? okMessage = null)
		{
			Error result;
			if (response.IsSuccessStatusCode)
			{
				if (okMessage != null)
				{
					ShowNotification(NotificationType.Success, okMessage);
				}
			}
			else if (response is IBadRequest<Error> badRequest && badRequest.TryBadRequest(out result))
			{
				string valueFromCulture = localizer.GetValueFromCulture(result.Code);
				ShowNotification(NotificationType.Warning, valueFromCulture);
			}
			else
			{
				ShowNotification(NotificationType.Error, Resources.AnUnexpectedErrorOccured);
			}
		}

		private static void OpenXModoWebsite()
		{
			Process.Start(new ProcessStartInfo
			{
				FileName = "https://www.xmodo.cn/?utm_source=readyM&utm_content=WukongMP&_channel_track_key=5iKzBDDv",
				UseShellExecute = true
			});
		}
