	public sealed class ViewSwitcher(IServiceProvider services) : IViewSwitcher
	{
		public void SwitchToView(ViewType viewType)
		{
			if (Dispatcher.UIThread.CheckAccess())
			{
				SwitchToViewImpl(viewType);
				return;
			}
			Dispatcher.UIThread.Post(delegate
			{
				SwitchToViewImpl(viewType);
			});
		}

		private void SwitchToViewImpl(ViewType viewType)
		{
			Window window = viewType switch
			{
				ViewType.Login => new LogInWindow
				{
					DataContext = services.GetRequiredService<LogInWindowViewModel>()
				}, 
				ViewType.GameSelection => new SelectGameWindow
				{
					DataContext = services.GetRequiredService<SelectGameViewModel>()
				}, 
				ViewType.Coop => new WukongCoopWindow
				{
					DataContext = services.GetRequiredService<WukongCoopViewModel>()
				}, 
				ViewType.Pvp => new WukongPvpWindow
				{
					DataContext = services.GetRequiredService<WukongPvpViewModel>()
				}, 
				ViewType.LinkWithXModo => new LinkWithXModoWindow
				{
					DataContext = services.GetRequiredService<LinkWithXModoWindowViewModel>()
				}, 
				_ => throw new ArgumentOutOfRangeException("viewType", viewType, null), 
			};
			App.Instance.AssignMainWindow(window);
		}

		public void ShowErrorView(string errorMessage)
		{
			if (Dispatcher.UIThread.CheckAccess())
			{
				SplashErrorScreen window = new SplashErrorScreen(errorMessage);
				App.Instance.AssignMainWindow(window);
				return;
			}
			Dispatcher.UIThread.Post(delegate
			{
				SplashErrorScreen window2 = new SplashErrorScreen(errorMessage);
				App.Instance.AssignMainWindow(window2);
			});
		}
	}
